import React from "react";
import TextField from "@material-ui/core/TextField";
import Grid from "@material-ui/core/Grid";

const MovieList = () => {
  return (
    <div>
      <React.Fragment>
        <Grid container spacing={4}>
          <Grid item>
            <TextField
              type="text"
              id="outlined-basic"
              label="Search"
              variant="outlined"
            />
          </Grid>
        </Grid>
      </React.Fragment>
    </div>
  );
};

export default MovieList;
